import React, { useState,useEffect } from "react";
import { ListOfGoals } from "../ApiManager"

export const GoalList = () => {
  const [goallist, setGoalList] = useState([]);

      useEffect(
         () => {
            ListOfGoals()
            .then((data) => {
               setGoalList(data)
               console.log(data)
            })
         }, []
      )

  const unixTime = (time) => {
      const myDate = new Date(time)
      const myDateString = `${myDate.getMonth()}/${myDate.getDate()}/${myDate.getFullYear()}`
  }

  return (
     <>
     <h1>Goal List</h1>

      {
         goallist.map((goal) => {
            return (
               <div key={goal.id}>
                  <p>
                  {goal.goalDescription}{goal.goalNotes}{unixTime(goal.goalDate)}
                     </p>
                     </div>
            )
         })
      }


    </>
  );
};
